import React from "react";
import "./Cities.css";

export default function Cities() {
  return (
    <ul className="Cities">
      <li>Sydney</li>
      <li>Paris</li>
      <li>Montreal</li>
      <li>Lisbon</li>
      <li>San Francisco</li>
    </ul>
  );
}
